<style>
body {font-family: "Noto Sans KR", sans-serif; margin: 0; padding: 0; overflow: hidden; height: 100%;}
.tab {
  overflow: hidden;
  background-color: #f8f9fa;
  border-bottom: 1px solid #ddd;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 0 10px;
  height: 50px;
}
.tab-group { display: flex; height: 100%; }
.tab button {
  background-color: inherit;
  border: none;
  outline: none;
  cursor: pointer;
  padding: 0 20px;
  font-size: 15px;
  font-weight: 600;
  color: #666;
  height: 100%;
  transition: 0.2s;
}
.tab button:hover { background-color: #e9ecef; color: #333; }
.tab button.active { background-color: #fff; color: #2563eb; border-bottom: 3px solid #2563eb; }
.fullscreen-btn {
  background-color: #ef4444; color: white; border: none;
  border-radius: 4px; padding: 6px 12px; font-size: 13px; cursor: pointer;
  font-weight: bold;
}
.fullscreen-btn:hover { background-color: #dc2626; }
.tabcontent {
  width: 100vw; 
  height: calc(100vh - 50px); /* 100vh(화면 전체) - 탭 높이(50px) */
  border: none;
}
</style>

<script>
function openCity(evt, cityName) {
  var i, tabcontent, tablinks;
  tabcontent = document.getElementsByClassName("tabcontent");
  for (i = 0; i < tabcontent.length; i++) { tabcontent[i].style.display = "none"; }
  tablinks = document.getElementsByClassName("tablinks");
  for (i = 0; i < tablinks.length; i++) { tablinks[i].className = tablinks[i].className.replace(" active", ""); }
  document.getElementById(cityName).style.display = "block";
  evt.currentTarget.className += " active";
  window.dispatchEvent(new Event('resize'));
}
function toggleFullScreen() {
  if (!document.fullscreenElement) { document.documentElement.requestFullscreen(); }
  else { if (document.exitFullscreen) { document.exitFullscreen(); } }
}
</script>
